import React from "react";
import "./sidebar.css";
import Portfolio from "./images/Portfolio.jpg";

class Sidebar extends React.Component {
  render() {
    return <div className="col-xs-12 col-sm-12 col-md-3 col-lg-3" id="nav" />;
  }
}

export default Sidebar;
